Walsall Council are seeking a single Provider to deliver a robust Media Monitoring and Social Media Insight service. 
      
      The Service shall include, but not be limited to;
       
      Press Monitoring - Monitoring of specified keywords and topics within printed content;
      
      Online Monitoring - Monitoring of news website content that include specified keywords and topics including monitoring of non-written content such as imagery or info graphics
      
      Social Media Monitoring - an online tool to enable The Council to monitor and analyse social media content from a range of social media platforms including, but not limited to, Twitter, LinkedIn, Facebook, blogs and public forums; 
      
      Broadcast Monitoring - Monitoring content on television, radio and web broadcasts that include specified keywords and topics
      
      Evaluation and Analysis - The selection, evaluation and analysis of the results of monitoring through human review or via automated evaluation of data; and
      
      Social Media Scheduling Tool - to enable the scheduling of planned content across a range of social media platforms including but not limited to Twitter, LinkedIn, Facebook, blogs and other public forums.

