Additional information: Please note that Walsall Council have a new Contract opportunity. 

For further details of the requirement, please see the following link to the Councils` e-Procurement web portal;

https://in-tendhost.co.uk/walsallcouncil

You will be required to register your organisation (if already not done so) and express your interest in the relevant project/opportunity.



Is a Recurrent Procurement Type? : No

The purpose of the contract is to manage and deliver the Participant Recruitment and Engagement element of the REACT- 1 programme.

The Services will continue to build a detailed picture through the level of features listed below.
(The list is not necessarily exhaustive, the Supplier will include in the detailed picture at no extra cost where reasonable to do so, additional features where it makes sense to do so to add to the overall picture)
•	infection prevalence
•	R number
•	Seroprevalence (regional and national)
•	Seroprevalence (by population sub-groups and demographics)

These features are intended to inform crucial work by SPI-M, JBC, across Government and beyond as necessary.

The number of Rounds will be as agreed between the Customer and the Supplier. The commencement of a new Round will be at the absolute discretion of the Customer (through the Customer representative) at which point the duration and scope of the Round will be agreed.

The key deliverables required under this Contract are as follows;
•	data sample is requested from NHSD;
•	draft, print and post participant invitation letters;
•	draft, print and post participant invitation letters;
•	draft and send text message reminders;
•	maintain participant registration portal;
•	inform participants of test results;
•	provide test result data to academic partner on a daily basis whilst study is in the field;
•	provide test results to PHE via SGSS on a daily basis whilst study is in the field;
•	design and maintain participant survey; portal for survey and undertake data capture and some analysis for the academic partner;
•	provide and operate a helpdesk and therefore answer participant enquiries.

In order to maintain the linkage between swabs and participants this commission might include a further option to add an additional minor element to the scope for each round. This requirement relates to, test kit barcoding, linkage and dispatch as outlined below; and exercise of this option will be at the total discretion of the Customer through the Customer representative and will be instructed as and when required for each Round:

•	receiving swab* test kits and individually packing these with the REACT booklet, and REACT ID label which links the participant to their specific kit;
•	posting kits out to participants as per timelines for each Round;
*Each swab must be linked to the correct person so that all participants receive the correct test result back, which is imperative to the study findings being correct.

Defra group Commercial are looking to appoint a consultant to:
-	Support and lead the delivery of projects, procurements and contract / supplier management roles across an allocated customer category;
-	Support the management and development of key supplier relationships to deliver exceptional performance in cost, service and quality; 
-	Build and sustain effective relationships with category customers; 
-	Provide day to day advice on commercial issues and governance across the relevant category, taking full account of risk, exploiting commercial opportunities and maximising value of money and savings.
